static void
preparse_number(char *num_str, int *basep, const char *text, size_t len)
{
  size_t i = 0, j = 0;
  int base = 10;

  if(text[0] == '+' || text[0] == '-')
  {
    i = 1;
  }

  if(text[i] == '0')
  {
    switch(text[i + 1])
    {
      case 'd':
      case 'D':
        base = 10;
        i += 2;
        break;
      case 'x':
      case 'X':
        base = 16;
        i += 2;
        break;
      case 'o':
      case 'O':
        base = 8;
        i += 2;
        break;
      case 'b':
      case 'B':
        base = 2;
        i += 2;
        break;
      default:
        evoasm_fatal("invalid number format");
        abort();
    }
  }

  for(; i < len; i++)
  {
    if(text[i] != '_')
    {
      num_str[j++] = text[i];
    }
  }
  num_str[j] = '\0';
  *basep = base;
}

